    const googleSIgnin =  async() => {
        try {
            await signInWithPopup();
        } catch (error) {
            console.log(error)
        }
    }


    return (
        <div style={{backgroundColor: "#181818", height: "100vh"}}>
            <img src="https://upload.wikimedia.org/wikipedia/commons/0/08/Netflix_2015_logo.svg" alt="netflix" style={{position: "fixed", left: "10%", top: "10%"}}/>
            <div style={{position: "fixed", left: "45%", top: "35%"}}>
            <Button variant="contained"  color ="error" onClick={googleSIgnin}>SignIn</Button>
            <br></br>
            <h2 style={{color: "white"}}>Let's Start <br/> to Explore Movies <br/>from Here.</h2>
            </div>
        </div>
    );
}

export default SignIn
